I’ve always had a deep fear of the ocean. Free diving forces me to get outside of my comfort zone and to reconnect with nature. This was my first time working on an underwater project and I can’t believe how challenging and beautiful it was to be a part of it. What I love the most about this video is how it captures the different perspectives all of us experience when we’re diving.
@emmett_sparling @chelseakauai & @josiahwg are amazing divers and creators that make free diving look much easier than it is in reality. I’m so grateful to have had the opportunity to learn from them in Indonesia! 
Thank you @corona for making this trip possible and for prioritizing sustainability to protect our oceans💙
